INSERT INTO `assign_parameter_values` VALUES (5473,916,'Nomenclature','Generator 20-30 KVA',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5474,916,'Name of Manufacturer/ Maker with full address','To be mentioned.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5475,916,'Name of Principal with full address','To be mentioned.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5476,916,'Name of Local Agent  with full address','To be mentioned.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5477,916,'Brand and Model','To be mentioned.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5478,916,'Country of Origin','To be mentioned.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5479,916,'Country of Manufacturer and','Australia, Austria, Belgium, Brazil, Canada, Denmark, Finland, France, Germany, Indonesia, Ireland, Japan, Luxemburg, Netherlands, Norway, Singapore, Spain, Sweden, Switzerland, Turkey, UK, USA and Italy.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5480,916,'Assembly','Australia, Austria, Belgium, Brazil, Canada, Denmark, Finland, France, Germany, Indonesia, Ireland, Japan, Luxemburg, Netherlands, Norway, Singapore, Spain, Sweden, Switzerland, Turkey, UK, USA and Italy.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5481,916,'Year of Production','Year of Production',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5482,917,'a. Overall Length, Width  & Height (canopied ) without Trailer','a. Overall Length, Width  & Height (canopied ) without Trailer',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5483,917,'b. Overall Length, Width & Height (canopied ) with Trailer','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5484,918,'a. Overall weight (Canopied) without Trailer','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5485,918,'b. Overall weight (Canopied) with Trailer','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5486,919,'a. Prime','Minimum 25 KVA',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5487,919,'b. Stand by','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5488,920,'a. Operation','Generator set to be able to sustain 12 hours continuous operation per day at prime load. Overload of 10% to be sustain for 1 hour in every 12 hours operation. Standby (maximum) power to be available at variable load in the event of main power network failure.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5489,920,'b. Noise','The generator must have noise suppression system and able to operate in the open  and in all-weather condition',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5490,920,'c. Canopy','Should be made of anticorrosive steel sheet and fireproof painting. Should be able to attenuate sound up to (maximum) db 90 at 1 meter having lockable louvers, doors. Glass windows for monitoring the meters to be provided. Fire retardant superior quality foam to be pasted inside the canopy.  Color: MB Green (British Colour Code no BS381 223).',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5491,920,'d. Transportation','The generator must have all provisions for transporting it by vehicle, transporter and trailer. Required number of hooks to be provided in required points of the frame of generator so that it can be lifted by crane. Number of hooks to be mentioned.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5492,920,'e. Mounting','The generator to be mounted on its base with anti-vibration mounting.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5493,920,'f. Starting System','Self-starter with auto provision',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5494,920,'g. Safety Feature','The generator must shutdown with sound warning against over voltage, over current, over load, Low/high oil pressure over temperature etc.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5495,920,'h. Overall Efficiency','To be mentioned (To be compatible between engine and alternator)',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5496,920,'j. Mobility','The Generator to be trailer mounted and suitable for road and cross country mobility',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5497,921,'a. Name of Manufacturer/Maker','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5498,921,'b. Model','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5499,921,'c. Country of Origin','Australia, Austria, Belgium, Brazil, Canada, Denmark, Finland, France, Germany, Indonesia, Ireland, Japan, Luxemburg, Netherlands, Norway, Singapore, Spain, Sweden, Switzerland, Turkey, UK, USA and Italy.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5500,921,'d. Country of Manufacturer and Assembly','Australia, Austria, Belgium, Brazil, Canada, Denmark, Finland, France, Germany, Indonesia, Ireland, Japan, Luxemburg, Netherlands, Norway, Singapore, Spain, Sweden, Switzerland, Turkey, UK, USA and Italy.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5501,921,'e. Year of Production','Not earlier than the year of contract',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5502,921,'f. Type of Engine','4 stroke Diesel Engine.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5503,921,'g. Number of Cylinders','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5504,921,'h. Bore/Stroke','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5505,921,'j. Capability','Prime power available at variable load with a load factor not exceeding 80% of prime power rating. Overload of 10% is permitted for 1 hour in every 12 hours operation.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5506,921,'k. Piston Displacement','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5507,921,'l. Compression Ratio','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5508,921,'m. Output power (KW) with RPM','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5509,921,'n. Cooling System','Liquid cooling.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5510,921,'p. Turbo  charger (if available)','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5511,921,'q. Specific Fuel Consumption Liters/hour at full load','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5512,921,'r. Starting Voltage','12/24 volt DC, AH of starting battery minimum 70AH',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5513,921,'s. Engine Alternator','Capacity to be mentioned (Volt, Amp and KW). Self-battery charging by engine driven',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5514,921,'t. Engine Efficiency','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5515,921,'u. Weight of Engine','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5516,921,'v. Fuel Tank Capacity','To be mentioned(Should be compatible for 12 hours continuous operations)',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5517,921,'w. Battery Charging Facilities','Self-battery charging by engine driven dynamo/ alternator',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5518,921,'x.  Self-Starter','Volt and KW to be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5519,922,'a.  Name of Manufacturer/ Maker','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5520,922,'b.  Model','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5521,922,'c.  Country of Origin','Australia, Austria, Belgium, Brazil, Canada, Denmark, Finland, France, Germany, Indonesia, Ireland, Japan, Luxemburg, Netherlands, Norway, Singapore, Spain, Sweden, Switzerland, Turkey, UK, USA and Italy',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5522,922,'d.  Country of Manufacturer and Assembly','Australia, Austria, Belgium, Brazil, Canada, Denmark, Finland, France, Germany, Indonesia, Ireland, Japan, Luxemburg, Netherlands, Norway, Singapore, Spain, Sweden, Switzerland, Turkey, UK, USA and Italy.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5523,922,'e. Year of Production','Not earlier than the year of contract',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5524,922,'f.  Type','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5525,922,'g. Rated prime and standby output (KVA)','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5526,922,'h. Rated out put voltage','220V Single phase and 380-440 V AC (Specific Voltage) to be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5527,922,'j.  Frequency','50Hz',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5528,922,'k. Number of Phases & Wires','3 Phases 4 Wires.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5529,922,'l.  Power Factor  (Cos Ф)','Not less than 0.8.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5530,922,'m. Enclosure','SPDP',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5531,922,'n. Ventilation','Self-ventilated air cooled',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5532,922,'p. Insulation class','To be mentioned.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5533,922,'q. Voltage Regulation','Maximum ±1.5%',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5534,922,'r.  RPM','1500',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5535,923,'a. Meter & Gauges','Facility for displaying Volt, Ampere, Frequency, Fuel in tank, Oil Pressure, Running-Operating Hour, Water Temperature, KVA, KW, RPM,   Power Factor (pf) etc. to be provided and must be easily visible by the operator. All alarm and data logging system should be available.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5536,923,'b. Switches','Start & Stop key-push button with auto starter provision',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5537,923,'Power output Cable','4 x 25 M = 100 M single core per Generator flexible type std/adequate size (RM to be mentioned- compatible to 25 KVA), 3 phase with neutral power cable to be provided with each Generator with cable plugs- lugs at the delivery end & adequate size power plugs-lugs at the generator end-Out let.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5538,923,'Tool Kits','A complete set of tool kits to be provided with each set of Generator (List to be submitted).',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5539,923,'Trailer (Universal Type) for carrying Generator','Price to be quoted separately as per technical  specification (Appx 1 of Anx A)',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5540,923,'List of Standard Accessories (For full range of operation-use)','List to be submitted as per following proforma and to be provided accordingly:',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5541,924,'a. Foreign Training - Operational Training','Not required',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5542,924,'b. Foreign Training - Repair-Maintenance Training','Not required',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5543,924,'a. Local Training - Operational Training','01x AFNS Offr & 01x OTA for 02 weeks',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5544,924,'b. Local Training - Repair-Maintenance','Not required.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5545,924,'Warranty','03 (Three) years from the date of issuance of Inspection Note (I-Note) (One year full replacement warranty & 03 years service warranty).',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5546,924,'After sales service','Minimum  10 years from the date of installation with warranty period.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5547,924,'Certificate of quality','FDA-CE-JIS Certificate must be submitted with offer.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5548,924,'After Sale Service (Repair and Maintenance facilities)','Minimum 10 (ten) years {One year  free  warranty-guarantee and another 09 (nine) year warranty with payment}',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5549,924,'Any Other: If any item not specified in the above mentioned technical specification but required for the full range of operation, the bidder should specify and quote such item in their offer. In case of failure to specify and quote, the bidder must provide such items free of cost.','To be confirmed.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5550,925,'Operation-User Training','To be provided (As per requirement of user Dte)',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5551,925,'Repair,Maintenance and Trouble shootingTraining','To be provided (As per requirement of EME Dte)',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5552,925,'Inventory Control and Equipment Management Trainging','To be provided (As per requirement of Ord Dte)',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5553,925,'Orientation and Quality Control Mgt Trg','To be provided (As per requirement of ITD Dte)',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-02-15 03:34:17','2024-02-15 03:34:17'),(5554,925,'a. SST-measuring & testing-fault