 so that it can be lifted by crane. Number of hooks to be mentioned.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6112,45,'e. Mounting','The generator to be mounted on its base with anti-vibration mounting.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6113,45,'f. Starting System','Self-starter with auto provision',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6114,45,'g. Safety Feature','The generator must shutdown with sound warning against over voltage, over current, over load, Low/high oil pressure over temperature etc.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6115,45,'h. Overall Efficiency','To be mentioned (To be compatible between engine and alternator)',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6116,45,'j. Mobility','The Generator to be trailer mounted and suitable for road and cross country mobility',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6117,46,'a. Name of Manufacturer/Maker','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6118,46,'b. Model','To be mentioned',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6119,46,'c. Country of Origin','Australia, Austria, Belgium, Brazil, Canada, Denmark, Finland, France, Germany, Indonesia, Ireland, Japan, Luxemburg, Netherlands, Norway, Singapore, Spain, Sweden, Switzerland, Turkey, UK, USA and Italy.',3,'23.01.901.047.02.192.07.24.10.21',NULL,'2024-03-14 04:06:22','2024-03-14 04:06:22'),(6120,46,'d. Country of Manufacturer and Assembly','Australia, Austria, Belgium, Brazil, Canada, Denmark, Finland, France, Germany, Indonesia, Ireland, Japan, Luxemburg, Netherlands, Norway, Singapore, Spain, Sweden, Switzerland, Turkey, UK, USA and Italy.',3,'23.01.901.0